import React, { useState, useEffect }  from 'react'
import { Container, Row, Col } from 'react-bootstrap'
import { FaChevronLeft } from 'react-icons/fa'
import Exercise from './Exercise'

const DailyWorkout = ({closeDailyWorkout, workoutDay, plan}) => {

    const dailyWorkout = plan.days.filter(day => day.date === workoutDay)

    return (
        <Container>
        <Row className="my-3">
            <Col><FaChevronLeft style={{cursor: 'pointer'}} onClick={closeDailyWorkout}/></Col>
            <Col>{dailyWorkout.name}</Col>
        </Row>
        {JSON.stringify(dailyWorkout)}
        </Container>
    )
}
export default DailyWorkout
